// import Swiper JS
import Swiper from "swiper";
// import Swiper styles
import "swiper/css";

import { Navigation, Pagination } from "swiper/modules";
// import Swiper and modules styles
import "swiper/css/navigation";
import "swiper/css/pagination";
//Images
import testimonialCircleOneLarge from "../images/testimonial-circle-1-large.png";
import testimonialCircleTwoLarge from "../images/testimonial-circle-2-large.png";
import testimonialCircleThreeLarge from "../images/testimonial-circle-3-large.png";
interface SliderProps {
  // Define the props for your Slider component here if needed
}

function Slider(props: SliderProps) {
  const swiper = new Swiper(".swiper", {
    modules: [Navigation, Pagination],
    breakpoints: {
      "@0.75": {
        slidesPerView: 2,
        spaceBetween: 20,
      },
      "@1.00": {
        slidesPerView: 3,
        spaceBetween: 40,
      },
      "@1.50": {
        slidesPerView: 4,
        spaceBetween: 50,
      },
    },
  });

  return (
    <div className="swiper">
      <div className="swiper-wrapper">
        <div className="swiper-slide">
          <img src={testimonialCircleOneLarge} alt="testimonial-1-img-large" />
          <div className="swiper-card">
            <div className="name">
              <h4>Lance Hyland</h4>
              <p>Organic Farm Manager</p>
            </div>
            <p className="text">
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Obcaecati
              enim suscipit culpa, dolores corporis cupiditate.
            </p>
          </div>
        </div>
        <div className="swiper-slide">
          <img className="testimonial-img"
            src={testimonialCircleThreeLarge}
            alt="testimonial-3-img-large"
          />
          <div className="swiper-card">
            <div className="name">
              
              <h4>Shae Cox</h4>
              <p>Marketing Consultant</p>
            </div>
            <p className="text">
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Obcaecati
              enim suscipit culpa, dolores corporis cupiditate.
            </p>
          </div>
        </div>
        <div className="swiper-slide">
          <img
            src={testimonialCircleThreeLarge}
            alt="testimonial-3-img-large"
          />
          <div className="swiper-card">
            <div className="name">
              <h4>James Krever</h4>
              <p>Proffessional Chef</p>
            </div>
            <p className="text">
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Obcaecati
              enim suscipit culpa, dolores corporis cupiditate.
            </p>
          </div>
        </div>
        ...
      </div>
    </div>
  );
}

export default Slider;
